import React, {Component} from 'react';

class App extends Component {

    constructor(props) {
        super(props);
        this.state= {
            items: [],
            isLoaded: false,
        }
    }

    componentDidMount() {

        fetch('https://opendata.paris.fr/api/v2/catalog/datasets/que-faire-a-paris-/records?limit=1&pretty=false&timezone=UTC')
            .then(res => res.json())
            .then(json => json.records.map(record => record.record))
            .then(json => { console.log(json)
                this.setState({
                    isLoaded: true,
                    items: json,
                })
            });

    }

    render() {

        var { isLoaded, items } = this.state;

        if (!isLoaded) {
            return <div>Chargement...</div>;
        }

        else {

            return (
                <div className="App">
                    {items.map(item => (
                            <li key={item.id}>
                                {item.fields.title}
                                {item.fields.date_start}
                                {item.fields.lead_text}
                            </li>
                        ))}


                </div>
            );
        }

    }
}

export default App;
